not_subsumes_pabc_qa(P,Q):- holds(P,(A,B,C)), holds(Q,(_,)), not holds(Q,(A,)).

%% p(A,B,C) implies q(B)
prop(subsumes_pabc_qb,(P,Q)):- holds(P,(A,B,C)), holds(Q,(B,)), type(P,(Ta,Tb,Tc)), type(Q,(Tb,)), not not_subsumes_pabc_qb(P,Q).
