%% minus(A,B,C),divisible(C,B)
prop(pabc_implies_qcb,(P,Q)):- holds(P,(A,B,C)), holds(Q,(C,B)), holds(P,(X,Y,Z)), #count{Z,Y: not holds(Q,(Z,Y))} == 0.

%% p(A,B,C,D) implies q(C,D)
prop(pabcd_implies_qcd,(P,Q)):- holds(P,(A,B,C,D)), holds(Q,(C,D)), holds(P,(_,_,X,Y)), #count{X,Y: not holds(Q,(X,Y))} == 0.


prop(chain,(P,Q)):- type(P,(_,Ta)), type(Q,(Ta,_)), body_pred(P,_), body_pred(Q,_), not chain_sat((P,Q)).
chain_sat((P,Q)):- body_pred(P,_), body_pred(Q,_), type(P,(_,Ta)), type(Q,(Ta,_)), holds(P,(_,A)), holds(Q,(A,_)).

prop(precon,(P,Q)):- type(P,(Ta,)), type(Q,(Ta,_,)), body_pred(P,1), body_pred(Q,2), #count{A : holds(P,(A,)), holds(Q,(A,_))} == 0.
prop(postcon,(P,Q)):- type(P,(Ta,Tb)), type(Q,(Tb,)), body_pred(P,2), body_pred(Q,1), #count{B : holds(P,(_,B)), holds(Q,(B,))} == 0.

prop(pre_postcon,(P,Q,R)):- type(P,(Ta,)), type(Q,(Ta,Tb)), type(R,(Tb,)), body_pred(P,_), body_pred(Q,_), body_pred(R,_), not pre_postcon_sat((P,Q,R)).
pre_postcon_sat((P,Q,R)):-
    type(P,(Ta,)),
    type(Q,(Ta,Tb)),
    type(R,(Tb,)),
    body_pred(P,_),
    body_pred(Q,_),
    body_pred(R,_),
    holds(P,(A,)),
    holds(Q,(A,B)),
    holds(R,(B,)).

prop(pab_qac,(P,Q)):-
    type(P,(Ta,_)),
    type(Q,(Ta,_)),
    body_pred(P,_),
    body_pred(Q,_),
    P < Q,
    not pab_qac_sat((P,Q)).
pab_qac_sat((P,Q)):-
    P < Q,
    body_pred(P,_),
    body_pred(Q,_),
    type(P,(Ta,_)),
    type(Q,(Ta,_)),
    holds(P,(A,_)),
    holds(Q,(A,_)).

prop(pab_qca,(P,Q)):-
    type(P,(Ta,_)),
    type(Q,(_,Ta)),
    body_pred(P,_),
    body_pred(Q,_),
    P < Q,
    not pab_qca_sat((P,Q)).
